import React, { useEffect } from 'react';

function TimerTimer() {
    useEffect(() => {
        console.log("timer render");
    })
    return (
        <section className='flex'>
            <h2>00</h2>
            :
            <h3>00</h3>
            .
            <h4>00</h4>
        </section>
    )
}

export default TimerTimer;
